import React from "react";
import "./../styles/GraphVisualization";

const GraphVisualization = ({ matrix }) => {
    return (
        <section id="visualization-section">
            <h2>Візуалізація графу</h2>
            <div id="graph-visualization">
                {matrix.length > 0 ? (
                    <pre>{JSON.stringify(matrix, null, 2)}</pre>
                ) : (
                    <p>Граф з'явиться тут після введення даних.</p>
                )}
            </div>
        </section>
    );
};

export default GraphVisualization;
